def prime_factors(lst):
    num = lst[851]
    factors = set()
    i = 2
    while i * i <= num:
        if num % i:
            i += 1
        else:
            num //= i
            factors.add(i)
    if num > 1:
        factors.add(num)
    return factors
```
Note: The code assumes that the list has at least 852 elements to avoid any errors.
